// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract RowBoatNFT is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    ERC20 public paymentCurrency;
    ERC721 public requiredNFT1;
    ERC721 public requiredNFT2;
    ERC721 public requiredNFT3;

    uint256 public requiredAmount;

    constructor(
        ERC20 _paymentCurrency,
        ERC721 _requiredNFT1,
        ERC721 _requiredNFT2,
        ERC721 _requiredNFT3,
        uint256 _requiredAmount
    ) ERC721("RowBoatNFT", "RowBoat") {
        require(
            address(_paymentCurrency) != address(0),
            "Token address can't be address zero"
        );
        require(address(_requiredNFT1) != address(0), "Addresss can't be zero");
        require(address(_requiredNFT2) != address(0), "Addresss can't be zero");
        require(address(_requiredNFT3) != address(0), "Addresss can't be zero");
        require(_requiredAmount > 0, "amount cannot be zero");
        paymentCurrency = _paymentCurrency;
        requiredNFT1 = _requiredNFT1;
        requiredNFT2 = _requiredNFT2;
        requiredNFT3 = _requiredNFT3;
        requiredAmount = _requiredAmount;
    }

    //Setter Functions

    function setPaymentCurrency(ERC20 _paymentCurrency) public onlyOwner {
        require(
            address(_paymentCurrency) != address(0),
            "Token address can't be address zero"
        );
        paymentCurrency = _paymentCurrency;
    }

    function setRequiredNFT1(ERC721 _requiredNFT) public onlyOwner {
        require(address(_requiredNFT) != address(0), "Address can't be zero");
        requiredNFT1 = _requiredNFT;
    }

    function setRequiredNFT2(ERC721 _requiredNFT) public onlyOwner {
        require(address(_requiredNFT) != address(0), "Address can't be zero");
        requiredNFT2 = _requiredNFT;
    }

    function setRequiredNFT3(ERC721 _requiredNFT) public onlyOwner {
        require(address(_requiredNFT) != address(0), "Address can't be zero");
        requiredNFT3 = _requiredNFT;
    }

    function setRequiredAmount(uint256 _requiredAmount) public onlyOwner {
        require(_requiredAmount > 0, "Amount cannot be zero");
        requiredAmount = _requiredAmount;
    }

    // buy function

    function buyRowBoat() public {
        require(
            paymentCurrency.transferFrom(msg.sender, address(this), 10 ether),
            "Failed to process payment!"
        );
        uint256 tokenId = (_tokenIdCounter.current());
        uint256 currentIndex = (tokenId % 10);
        if (currentIndex == 0) {
            currentIndex = 10;
        }
        _tokenIdCounter.increment();
        _safeMint(msg.sender, tokenId);
        _setTokenURI(
            tokenId,
            string(
                abi.encodePacked(
                    "https://gateway.pinata.cloud/ipfs/QmdokG9tmeRSNwyDVBN9CGHXtX2pPAzxR1PycaSpjnGkBB/RowBoat",
                    Strings.toString(currentIndex),
                    ".json"
                )
            )
        );
    }

